import "./mission.css";

export default function mission(props){

    function vision(){
        console.log("time to shine");
    }

    return(
    <div className="mission">
        <div className="missionLeft">
            <h1 className="missionTitle">Mission Statement</h1>
            <p className="missionBody">Our mission is that we want to provide the bwsr thibg that we cab in the limited amount of time that we have so that the thing that is to be buid can be benificiary for the socity as a whole in the future mission is that we want to provide the bwsr thibg that we cab in the limited amount of time that we have so that the thing that is to be buid can be benificiary for the socity as a whole in the future  mission is that we want to provide the bwsr thibg that we cab in the limited amount of time that we have so that the thing that is to be buid can be benificiary for the socity as a whole in the future  mission is that we want to provide the bwsr thibg that we cab in the limited amount of time that we have so that the thing that is to be buid can be benificiary for the socity as a whole in the future mission is that we want to provide the bwsr thibg that we cab in the limited amount of time that we have so that the thing that is to be buid can be benificiary for the socity as a whole in the future</p>
          <button>Vision</button>
        </div>
        <div className="missionRight">
            <div className="blackBack">
            <img className="missionImg" src={props.missionImg}/>
            </div>
        </div>
    </div>
    );
}
